  handleGeocoder = (map) => {
    const geocoder = new MapboxGeocoder({
      accessToken: mapboxgl.accessToken, // Set the access token
      mapboxgl: mapboxgl, // Set the mapbox-gl instance
      marker: false, // Do not use the default marker style
      bbox: [8.08997684086, 54.8000145534, 12.6900061378, 57.730016588] // Set the bounding box coordinates
    });
    document.getElementById('geocoder').appendChild(geocoder.onAdd(map))
    map.addControl(new mapboxgl.FullscreenControl());
    map.resize();
  }
  handleFlyTo = (map, currentFeature, point) => {
    if (currentFeature.geometry.type === 'Polygon') {
      map.flyTo({
        center: point.geometry.coordinates,
        zoom: 12
      });
    }
    else {
      map.flyTo({
        center: point.geometry.coordinates,
        zoom: 12
      })
    }
  }

  handlePopup = (map, currentFeature, point) => {
    // console.log(currentFeature)
    const popUps = document.getElementsByClassName('mapboxgl-popup');
    // Check if there is already a popup on the map and if so, remove it
    if (popUps[0]) popUps[0].remove();

    new mapboxgl.Popup()
      .setLngLat(point.geometry.coordinates)
      .setHTML('<h3>Safety Zone</h3>' +
        '<h4>' + currentFeature.properties.name + '</h4>')
      .addTo(map);
  }
